43X)"]},{"cell_type":"markdown","id":"39251115","metadata":{"papermill":{"duration":0.009281,"end_time":"2023-12-06T12:18:20.248811","exception":false,"start_time":"2023-12-06T12:18:20.23953","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"65ae4335","metadata":{"papermill":{"duration":0.009565,"end_time":"2023-12-06T12:18:20.268776","exception":false,"start_time":"2023-12-06T12:18:20.259211","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"34655bcc","metadata":{"execution":{"iopub.execute_input":"2023-12-06T12:18:20.292176Z","iopub.status.busy":"2023-12-06T12:18:20.29007Z","iopub.status.idle":"2023-12-06T12:18:20.36871Z","shell.execute_reply":"2023-12-06T12:18:20.366656Z"},"papermill":{"duration":0.092961,"end_time":"2023-12-06T12:18:20.371388","exception":false,"start_time":"2023-12-06T12:18:20.278427","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>abr